export default class FundraisingProjects extends ReactComponent {
    constructor() {
        super();

        this.state = {
            fps : null
        };
    }

    componentWillMount() {
        this.fetchAllProjects();
    }

    fetchAllProjects() {
        fetch(`http://localhost:18080/fundraising-projects/all`, {
            method: 'GET',
            headers: new Headers({
                "Authorization": sessionStorage.jwtToken
            })
        })
            .then(response => response.json())
            .then(json => {
                this.setState({fps : json})
            });
    }


